            text-align: right;
            grid-area: yAchse;
            border-right: 3px solid #000;
            width: 3rem;
          }
          .graph {
            position: relative;
          }
          .xLabel {
            position: absolute;
            transform: translate(-50%, -50%);
            top: 50%;
            left: calc(var(--graphPadding) + (var(--x) - var(--xMin)) / (var(--xMax) - var(--xMin)) * (100% - 2 * var(--graphPadding)));
          }
          .xLine {
            position: absolute;
            left: calc(var(--graphPadding) + (var(--x) - var(--xMin)) / (var(--xMax) - var(--xMin)) * (100% - 2 * var(--graphPadding)));
            height: 100%;
            border-left: .1em dotted rgba(0,0,0,0.5);
            transform: translate(-50%);
          }
          .yLabel {
            position: absolute;
            width: 90%;
            left: 0;
            bottom: calc(var(--y) / var(--yMax) * 100%);
            transform: translateY(50%);
          }
          .yLine {
            position: absolute;
            bottom: calc(var(--y) / var(--yMax) * 100%);
            width: 100%;
            border-bottom: .1em dotted rgba(0,0,0,0.5);
            transform: translateY(50%);
          }
          .point {
            position: absolute;
            /*bottom: calc((var(--y) - var(--yMin)) / (var(--yMax) - var(--yMin)) * 100%);*/
            bottom: calc(var(--y) / var(--yMax) * 100%);
            left: calc(var(--graphPadding) + (var(--x) - var(--xMin)) / (var(--xMax) - var(--xMin)) * (100% - 2 * var(--graphPadding)));
            border-radius: 100%;
            display: block;
            width: calc(var(--count, 1) * var(--size));
            height: calc(var(--count, 1) * var(--size));
            background-color: #f00;
            background-color: rgb(calc(255 - (var(--y) - 2) * 255), calc((var(--y) - 2) * 10), 0);
            --size: 0.1em;
            transform: translate(-50%, 50%);
          }
          .point:hover{
            z-index: 2;
          }
          .point .label {
            display: inline-block;
            opacity: 0;
            background-color: #fff;
            padding: .5em;
            position: absolute;
            top: 50%;
            left: 100%;
            border-radius: .2em;
            border: .2em solid;
            border-color: rgb(calc(255 - (var(--y) - 2) * 255), calc((var(--y) - 2) * 25), 0);
            transform: translateY(-50%);
            pointer-events: none;
            width: 30ch;
          }
          .point:hover .label {
            opacity: 1;
          }
